  }

  /**
   * Not in an array of values.
   * @param {*} values
   */
  nin (...values) {
    this._setValue({ nin: values })
    return this._filter
  }

  /**
   * For geolocations, return the closest points, sorted in order of distance.
   * Use with limit to return the n closest points.
   * maxDistance and unit can also be passed on same level as near to configure the search.
   * @param {string} near
   * @param {number} maxDistance
   * @param {string} unit miles or meters. Default: miles
   */
  near (near, maxDistance = null, unit = null) {
    let value = near
    if (maxDistance) {
      value = Object.assign({}, { near, maxDistance })
    }
    if (unit) {
      value = Object.assign({}, { near, maxDistance, unit })
    }
    this._setValue(value)
    return this._filter
  }

  /**
   * LIKE operators for use with regular expressions
   * @param {string} value
   */
  like (value) {
    this._setValue({like: value})
    return this._filter
  }

  /**
   * NOT LIKE operators for use with regular expressions
   * @param {string} value
   */
  nlike (value) {
    this._setValue({nlike: value})
    return this._filter
  }

  /**
   * Regular expression
   * @param {string} regexp
   */
  regexp (regexp) {
    this._setValue({ regexp })
    return this._filter
  }

  /**
   * Sets the value to the filter builder
   * @param {*} value
   */
  _setValue (value) {
    let fields = this._filter._where

    if (this._filter._where.and !== undefined) {
      fields = this._filter._where.and[this._filter._where.and.length - 1]
    } else if (this._filter._where.or !== undefined) {
      fields = this._filter._where.or[this._filter._where.or.length - 1]
    }

    for (var key of Object.keys(fields)) {
      fields[key] = value
    }
  }
}

import { RequestError, ServerError } from '../errors'
import FilterBuilder from './filterBuilder' // eslint-disable-line no-unused-vars
import rp from 'request-promise'

class RequestService {
  /**
   * Initialize
   * @param {string} host
   * @param {string} apiToken
   * @param {string} accountId
   */
  init (host, apiToken, accountId) {
    this.host = host
    this.apiToken = apiToken
    this.accountId = accountId
    this.requester = rp.defaults({
      baseUrl: this.host,
      headers: {
        Authorization: this.apiToken
      }
    })
  }

  /**
   *
   * @param {string} endpoint
   * @param {string} method
   * @param {null|object} data
   * @param {null|FilterBuilder} filter
   *
   * @returns {Promise<Object|Object[], RequestError|ServerError>}
   */
  call (endpoint, method = 'GET', data = null, filter = null) {
    if (filter !== null) {
      endpoint = filter.buildUri(endpoint)
    }

    let requestProps = {
      method,
      uri: endpoint,
      resolveWithFullResponse: true,
      simple: true,
      json: true
    }

    if (data) {
      requestProps = Object.assign(requestProps, {
        body: data
      })
    }

    return this.requester(requestProps).then(response => {
      return response.body
    }).catch(response => {
      if (response.statusCode >= 400 && response.statusCode < 500) {
        return Promise.reject(new RequestError(response.statusCode, response.response.body.error))
      } else {
        return Promise.reject(new ServerError(response.statusCode, response.response.body.error))
      }
    })
  }
}

export const requestService = new RequestService()

